@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix atm: <http://lod.csd.auth.gr/atm/atm.ttl#> .

atm:CashCard a owl:Class .
atm:ATM a owl:Class .
atm:hasSerialNumber a owl:ObjectProperty ;
    rdfs:domain atm:CashCard ;
    rdfs:range xsd:string .
atm:hasBankCode a owl:ObjectProperty ;
    rdfs:domain atm:CashCard ;
    rdfs:range xsd:string .
atm:isValid a owl:ObjectProperty ;
    rdfs:domain atm:CashCard ;
    rdfs:range xsd:boolean .

atm:ATM rdfs:subClassOf [
    a owl:Restriction ;
    owl:onProperty atm:isValid ;
    owl:someValuesFrom [
        a owl:Class ;
        owl:intersectionOf (
            atm:CashCard
            [ a owl:Restriction ; owl:onProperty atm:hasSerialNumber ; owl:someValuesFrom xsd:string ]
            [ a owl:Restriction ; owl:onProperty atm:hasBankCode ; owl:someValuesFrom xsd:string ]
        )
    ]
] .
